import { trigger, state, style, transition, animate } from '@angular/animations';
import { Component, OnDestroy, OnInit } from '@angular/core';
import { MatTableDataSource } from '@angular/material/table';
import { Router, NavigationEnd } from '@angular/router';
import { tap, takeUntil, Subject } from 'rxjs';
import { Product } from 'src/app/interfaces/product';
import { ProductService } from 'src/app/services/product.service';

@Component({
  selector: 'app-product-page',
  templateUrl: './product-page.component.html',
  styleUrls: ['./product-page.component.sass'],
  animations: [
    trigger('loadedUnloadedList', [
      state('loaded', style({
        opacity: 1,
      })),
      state('unloaded', style({
        opacity: 0,
        paddingTop: "20px",
      })),
      transition('loaded => unloaded', [
        animate('0.5s ease-in')
      ]),
      transition('unloaded => loaded', [
        animate('0.5s ease-in')
      ])
    ]),
  ]
})
export class ProductPageComponent implements OnInit, OnDestroy {
  products: Product[] = [];
  destroy = new Subject<boolean>();
  loading = true;
  dataSource = new MatTableDataSource<Product>(this.products);
  testString: string = '';

  constructor(private productService: ProductService, private router: Router) {}

  ngOnInit(): void {
    this.router.events.pipe(takeUntil(this.destroy)).subscribe((val) => {
      if (val instanceof NavigationEnd) {
        this.loading = true;
      }
    });

    this.productService
      .retrieveAllProducts()
      .pipe(tap(() => (this.loading = true)), takeUntil(this.destroy))
      .subscribe((products) => {
        this.products = products.map((product) => ({
          ...product,
          image: this.getImageSrc(product.image),
        }));

        this.loading = false;
        console.log(this.products);
        this.dataSource = new MatTableDataSource<Product>(this.products);
      });
      console.log(this.base64ToByteArray(this.testString))
  }

  ngOnDestroy(): void {
    this.destroy.next(true);
    this.destroy.unsubscribe();
  }

  base64ToByteArray(base64String: string): Uint8Array {
    const binaryString = atob(base64String);
    const length = binaryString.length;
    const byteArray = new Uint8Array(length);
  
    for (let i = 0; i < length; i++) {
      byteArray[i] = binaryString.charCodeAt(i);
    }
  
    return byteArray;
  }

  getImageSrc(image: string): string {
    return 'data:image/jpeg;base64,' + image;
  }

  shouldDisplaySpinner(): boolean {
    return this.loading;
  }

  getStarArray(averageRating: number): string[] {
    const starArray = [];
    const fullStars = Math.floor(averageRating);
    const halfStars = Math.ceil(averageRating - fullStars);
    const emptyStars = 5 - fullStars - halfStars;
  
    for (let i = 0; i < fullStars; i++) {
      starArray.push('star');
    }
  
    for (let i = 0; i < halfStars; i++) {
      starArray.push('star_half');
    }
  
    for (let i = 0; i < emptyStars; i++) {
      starArray.push('star_border');
    }
  
    return starArray;
  }
}
